<!DOCTYPE html>
<html lang="vi">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Wedding Invitation</title>
    <script src="https://cdn.tailwindcss.com"></script>
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Playfair+Display:ital,wght@0,400;0,700;1,400&family=Montserrat:wght@200;300;400&display=swap" rel="stylesheet">
    <style>
        :root {
            --bg-color: #000000;
            --text-primary: #ffffff;
            --text-secondary: #a1a1aa;
            --accent: #ffffff;
        }

        body {
            background-color: var(--bg-color);
            color: var(--text-primary);
            font-family: 'Montserrat', sans-serif;
            scroll-behavior: smooth;
        }

        .serif {
            font-family: 'Playfair Display', serif;
        }

        .letter-spacing-widest {
            letter-spacing: 0.3em;
        }

        .fade-in {
            opacity: 0;
            transform: translateY(30px);
            transition: all 1.5s cubic-bezier(0.21, 0.45, 0.32, 0.9);
        }

        .fade-in.visible {
            opacity: 1;
            transform: translateY(0);
        }

        .cinematic-frame {
            position: relative;
            overflow: hidden;
            border: 1px solid rgba(255, 255, 255, 0.1);
        }

        .cinematic-frame::after {
            content: "";
            position: absolute;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            background: linear-gradient(180deg, rgba(0,0,0,0.2) 0%, rgba(0,0,0,0) 20%, rgba(0,0,0,0) 80%, rgba(0,0,0,0.2) 100%);
            pointer-events: none;
        }

        .divider {
            width: 1px;
            height: 100px;
            background: linear-gradient(to bottom, transparent, #ffffff, transparent);
            margin: 2rem auto;
        }
    </style>
</head>
<body class="antialiased">

    <!-- Main Content Wrapper -->
    <main class="max-w-screen-xl mx-auto px-6 py-20 min-h-screen flex flex-col items-center justify-center">
        
        <!-- Block 1: Short Text -->
        <section class="w-full text-center mb-24 fade-in" id="block-1">
            <p class="text-xs uppercase tracking-[0.5em] text-zinc-500 mb-8">Trân trọng kính mời</p>
            <h1 class="serif text-4xl md:text-6xl font-light italic mb-4">
                Thân chào {{khach_moi}}
            </h1>
            <div class="divider"></div>
        </section>

    <script>
        /**
         * Dynamic URL Parameter Replacement
         * Parses window.location.search and replaces {{key}} with value
         */
        function hydrateDynamicContent() {
            const params = new URLSearchParams(window.location.search);
            const bodyHtml = document.body.innerHTML;
            
            // Function to walk through text nodes to avoid breaking HTML structure
            function walkAndReplace(node) {
                if (node.nodeType === 3) { // Text node
                    let text = node.nodeValue;
                    params.forEach((value, key) => {
                        const placeholder = `{{${key}}}`;
                        if (text.includes(placeholder)) {
                            text = text.split(placeholder).join(value);
                        }
                    });
                    node.nodeValue = text;
                } else if (node.nodeType === 1) { // Element node
                    // Also check attributes like src
                    for (let i = 0; i < node.attributes.length; i++) {
                        let attr = node.attributes[i];
                        params.forEach((value, key) => {
                            const placeholder = `{{${key}}}`;
                            if (attr.value.includes(placeholder)) {
                                attr.value = attr.value.split(placeholder).join(value);
                            }
                        });
                    }
                    node.childNodes.forEach(walkAndReplace);
                }
            }

            walkAndReplace(document.body);
        }

        /**
         * Intersection Observer for Fade-in animations
         */
        function initAnimations() {
            const observerOptions = {
                threshold: 0.1
            };

            const observer = new IntersectionObserver((entries) => {
                entries.forEach(entry => {
                    if (entry.isIntersecting) {
                        entry.target.classList.add('visible');
                    }
                });
            }, observerOptions);

            document.querySelectorAll('.fade-in').forEach(el => observer.observe(el));
        }

        // Initialize on Load
        window.addEventListener('DOMContentLoaded', () => {
            hydrateDynamicContent();
            initAnimations();
        });
    </script>
